    "100040219": {
      "content": [
        "Users using Google Chrome on Mac machines need to perform additional configuration steps so that they can directly access the Legal Hold notices Perform the following configuration steps if Google Chrome browser is used on Apple Mac machine 1 Go to the Terminal application 2 Type these commands sudo defaults write Library Preferences com google Chrome plist AuthNegotiateDelegateWhitelist domain name com Where “domain name com” is the domain name of your eDiscovery Platform Contact your administrator for details sudo defaults write Library Preferences com google Chrome plist AuthServerWhitelist domain intra Where “domain intra” is the domain name of your eDiscovery Platform Contact your administrator for details 3 Open the Google Chrome browser Verify if settings are configured by typing chrome policy in the address bar 4 Try to open the Legal Hold notice URL 5 If you are not able to login perform the following additional steps a Open the Google Chrome browser In the address bar type chrome settings b Scroll down to the bottom of the page and then click Advanced to show more settings c Under System select Open proxy settings d Add the address of your eDiscovery Platform website by unlocking setting Click Ok"
      ],
      "title": [
        "Browser Configuration for Google Chrome on Apple Macintosh machines"
      ]
    },
