    "100040139": {
      "content": [
        "If the file usr openv netbackup NET BUFFER SZ is present in UNIX platforms for NetBackup 7 7 2 7 7 3 and 8 0 usr openv netbackup bin nbtar behaves differently than the legacy GNU tar ( usr openv netbackup bin tar) when the value is set to zero (0) In NetBackup 7 7 1 and earlier if usr openv netbackup NET BUFFER SZ is zero usr openv netbackup bin tar does not statically set network buffers (so sndbuffer and so rcvbuffer) and instead allows the operating system to manage network buffer settings for send buffers (so sndbuffer) and receive buffer (so rcvbuffer) In NetBackup 7 7 2 7 7 3 and 8 0 usr openv netbackup bin nbtar statically set both send (so sndbuffer) and receive (so rcvbuffer) buffers to 256 KB Because of this operating system management of network buffers no longer works for restores in NetBackup 7 7 2 7 7 3 and 8 0 This can impact performance differently than legacy usr openv netbackup bin tar Performance can be positive or negative depending on congestion in the network This is fixed in NetBackup 8 1 and later NetBackup 7 7 2 7 7 3 and 8 0 for Windows is not impacted because NetBackup for Windows does not have nbtar and instead uses tar32 exe Found usr openv netbackup NET BUFFER SZ and read a value of zero (0) 14 58 00 559 25745 25745 2 read legacy touch file Found usr openv netbackup NET BUFFER SZ requested from ( tarMain cpp 433) 14 58 00 559 25745 25745 2 read legacy touch file 0 read requested from ( tarMain cpp 433) 14 58 00 559 25745 25745 4 cTarMain setBufferSize INF Got NET BUFFER SZ value 0 bytes from TOUCH file Statically using a value of 262144 bytes or 256 Kilobytes for socket file descriptor ID 0 (zero) 14 58 00 559 25745 25745 4 cTarMain setBufferSize INF Using Buffer Size value 262144 bytes for network send buffer size14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO RCVBUF for socket (0)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO SNDBUF for socket (0)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP getsockopt Send buf size (262142) Recv buf size (262142) Statically using a value of 262144 bytes or 256 Kilobytes for socket file descriptor ID 1 14 58 00 559 25745 25745 4 cTarMain setBufferSize INF Request size for input fd (262144) Actual size (262142)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO RCVBUF for socket (1)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO SNDBUF for socket (1)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP getsockopt Send buf size (262142) Recv buf size (262142) Statically using a value of 262144 bytes or 256 Kilobytes for socket file descriptor ID 2 14 58 00 559 25745 25745 4 cTarMain setBufferSize INF Request size for output fd (262144) Actual size (262142)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO RCVBUF for socket (2)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP setsockopt success on SO SNDBUF for socket (2)14 58 00 559 25745 25745 2 tcp setsocksize DBG TCP getsockopt Send buf size (262142) Recv buf size (262142)14 58 00 559 25745 25745 4 cTarMain setBufferSize INF Request size for error fd (262144) Actual size (262142) Architectural differences between nbtar and legacy tar To address this in NetBackup 7 7 2 through 8 0 please contact VERITAS Technical Services for a hotfix Use the following references Etrack 3923348 NetBackup 8 0 3914428 NetBackup 7 7 3 3922853 NetBackup 7 7 2"
      ],
      "title": [
        "NetBackup 7.7.2, 7.7.3, and 8.0 nbtar behaves differently than the legacy (NetBackup version 7.7.1 and prior) GNU tar when the value of zero (0) is in the /usr/openv/netbackup/NET_BUFFER_SZ file."
      ]
    },
