    "100040524": {
      "content": [
        "For image cleanup jobs a CORBA connection is established between Media Server (bpdm) and Master Server (nbjm) Status is sent across this connection after each image is deleted If the cleanup of a disk image takes a long time there is no activity on the connection for that amount of time (say more than an hour) This idle connection may get closed by processes external to NetBackup after a certain amount of time When such a connection is attempted to be reused the job failure is reported with error 23 (socket read failed) Status code 23 socket read failed Some errors in bpdbm logs jmcomm processException retrying call after CORBA COMM FAILURE Some errors in libnbpxyhelper logs can be observed as below Error Desc NBPXY SE UNKNOWN Status Msg A SSL socket read failed Status 5 Msg nbu status 23 There may be TCP problems with the long idle socket or a Firewall between or on master server and media server might drop idle connections The timeout may vary depending upon firewall and TCP Keepalive settings To prevent the connection from being dropped external to NetBackup configure the TCP Keepalive settings appropriately that should keep the socket from being idle This should be done on the master server and optionally the media server Refer the article on TCP Keepalive Best Practices detecting network drops and preventing idle socket timeout Etrack 3927293; Etrack 3927293"
      ],
      "title": [
        "Long running disk image cleanup job fails with error code 23."
      ]
    },
