    "2961": {
      "content": [
        "We keep waffling on how we will handle characters in the server.  We need to understand the problem better and have a written record to support our decision.  We are trusting the callers of our interfaces to supply UTF8 encoded strings. We are resonable confident that we are storing UTF8 strings into, and getting UTF8 strings from the database.  Things to find out:  Where in the server do we handle strings as anything other than opaques? 1) Substitution - what items, from what formats, from what sources? What encoding are supported by the components with which we must integrate? What are these components? 1) Notification service 2) Task exec? 3) Unified logging What, if any, system calls do/will we make to manipulate/format string data?; WILL_NOT_CHANGE"
      ],
      "title": [
        "investigate our codepage/encoding once and for all and write down what we know"
      ]
    },
